import React from "react";
import {
  PageContainer,
  ContentContainer1,
  ContentContainer2,
  Title,
  SubContainer,
  Box,
} from "./styles/about_style.js";
import Card from "../components/card";

function About() {
  return (
    <>
      <PageContainer>
        <ContentContainer1>
          <Title>Building Tomorrow's Maritime Frontier</Title>
        </ContentContainer1>
        <ContentContainer2>
          <SubContainer>
            <Box>Test</Box>
          </SubContainer>
        </ContentContainer2>
      </PageContainer>
    </>
  );
}

export default About;
